import { NavigationContainer } from '@react-navigation/native';
import { createStackNavigator } from '@react-navigation/stack';
import GreetingsScreen from './screens/GreetingsScreen';
import MainUnauthScreen from './screens/MainUnauthScreen';
import AuthScreen from './screens/AuthScreen';
import RegScreen from './screens/RegScreen';
import ForgotScreen from './screens/ForgotScreen';
import HeaderLogoSvg from './assets/icons/headerLogoSvg';
import HeaderButton from './components/buttons/headerButton';
import { Button, TouchableHighlight, View } from 'react-native-web';
import SearchInput from './components/inputs/searchInput/searchInput';


const Stack = createStackNavigator();

const MainUnauth = () => {
  const [searchQuery, setSearchQuery] = useState('');
  const [filteredData, setFilteredData] = useState([]);

  const data = [
    { id: 1, title: 'Title 1', description: 'Description 1' },
    { id: 2, title: 'Title 2', description: 'Description 2' },
    { id: 3, title: 'Title 3', description: 'Description 3' },
    // Add more data here...
  ];

  const handleSearch = (query) => {
    setSearchQuery(query);
    const filtered = data.filter((item) =>
      item.title.toLowerCase().includes(query.toLowerCase())
    );
    setFilteredData(filtered);
  };

  return (
    <View style={{ flex: 1 }}>
      <View style={{ paddingTop: 20, paddingBottom: 10 }}>
        <SearchInput value={searchQuery} onChangeText={handleSearch} />
      </View>
      <ScrollView>
        {filteredData.map((item) => (
          <SearchBody key={item.id} data={item} />
        ))}
      </ScrollView>
    </View>
  );
};


const screens = [
  {
    name: 'Greetings',
    component: GreetingsScreen,
    options: ({ navigation }) => ({
      title: "",
      headerLeft: () => (
        <TouchableHighlight onPress={() => navigation.navigate('MainUnauth')}>
          <HeaderLogoSvg style={{ marginLeft: 20 }} />
        </TouchableHighlight>
      ),
      headerRight: () => (
        <HeaderButton
          style={{ marginRight: 20 }}
          title={"Войти"}
          onPress={() => navigation.navigate('Auth')}
        />
      ),
      headerShadowVisible: true,
      headerStyle: {
        height: 100,
        borderBottomWidth: 1,
        borderBottomColor: '#ccc',
        backgroundColor: '#fff',
        elevation: 3,
        justifyContent: "space-between",
        flexDirection: "row",
        alignItems: "center",
        paddingHorizontal: 20
      },
    }),
  },
  {
    name: 'MainUnauth',
    component: MainUnauthScreen,
    options: ({ navigation }) => ({
      title: "",
      headerLeft: () => (
        <TouchableHighlight onPress={() => navigation.navigate('MainUnauth')}>
          <HeaderLogoSvg style={{ marginLeft: 20 }} />
        </TouchableHighlight>
      ),
      headerRight: () => (

        <View style={{ flexDirection: 'row', alignItems: 'center' }}>
          <SearchInput style={{ marginRight: 10 }} />
          <View style={{ paddingHorizontal: 193 }} />
          <HeaderButton
            style={{ marginLeft: 10 }}
            title={"Войти"}
            onPress={() => navigation.navigate('Auth')}
          />
        </View>

      ),
      headerShadowVisible: true,
      headerStyle: {
        height: 100,
        borderBottomWidth: 1,
        borderBottomColor: '#ccc',
        backgroundColor: '#fff',
        elevation: 3,
        justifyContent: "space-between",
        flexDirection: "row",
        alignItems: "center",
        paddingHorizontal: 20
      },
    }),
  },
  {
    name: 'Auth',
    component: AuthScreen,
    options: ({ navigation }) => ({
      title: "",
      headerLeft: () => (
        <TouchableHighlight onPress={() => navigation.navigate('MainUnauth')}>
          <HeaderLogoSvg style={{ marginLeft: 20 }} />
        </TouchableHighlight>
      ),
      headerRight: () => (
        <View style={{ flexDirection: 'row', alignItems: 'center' }}>
        <SearchInput style={{ marginRight: 10 }} />
        <View style={{ paddingHorizontal: 193 }} />
        <HeaderButton
          style={{ marginLeft: 10 }}
          title={"Войти"}
          onPress={() => navigation.navigate('Auth')}
        />
      </View>
      ),
      headerShadowVisible: true,
      headerStyle: {
        height: 100,
        borderBottomWidth: 1,
        borderBottomColor: '#ccc',
        backgroundColor: '#fff',
        elevation: 3,
        justifyContent: "space-between",
        flexDirection: "row",
        alignItems: "center",
        paddingHorizontal: 20
      },
    }),
  },
  {
    name: 'Reg',
    component: RegScreen,
    options: ({ navigation }) => ({
      title: "",
      headerLeft: () => (
        <TouchableHighlight onPress={() => navigation.navigate('MainUnauth')}>
          <HeaderLogoSvg style={{ marginLeft: 20 }} />
        </TouchableHighlight>
      ),
      headerRight: () => (
        <View style={{ flexDirection: 'row', alignItems: 'center' }}>
        <SearchInput style={{ marginRight: 10 }} />
        <View style={{ paddingHorizontal: 193 }} />
        <HeaderButton
          style={{ marginLeft: 10 }}
          title={"Войти"}
          onPress={() => navigation.navigate('Auth')}
        />
      </View>
      ),
      headerShadowVisible: true,
      headerStyle: {
        height: 100,
        borderBottomWidth: 1,
        borderBottomColor: '#ccc',
        backgroundColor: '#fff',
        elevation: 3,
        justifyContent: "space-between",
        flexDirection: "row",
        alignItems: "center",
        paddingHorizontal: 20
      },
    }),
  },
  {
    name: 'Forgot',
    component: ForgotScreen,
    options: ({ navigation }) => ({
      title: "",
      headerLeft: () => (
        <TouchableHighlight onPress={() => navigation.navigate('MainUnauth')}>
          <HeaderLogoSvg style={{ marginLeft: 20 }} />
        </TouchableHighlight>
      ),
      headerRight: () => (
        <View style={{ flexDirection: 'row', alignItems: 'center' }}>
        <SearchInput style={{ marginRight: 10 }} />
        <View style={{ paddingHorizontal: 193 }} />
        <HeaderButton
          style={{ marginLeft: 10 }}
          title={"Войти"}
          onPress={() => navigation.navigate('Auth')}
        />
      </View>
      ),
      headerShadowVisible: true,
      headerStyle: {
        height: 100,
        borderBottomWidth: 1,
        borderBottomColor: '#ccc',
        backgroundColor: '#fff',
        elevation: 3,
        justifyContent: "space-between",
        flexDirection: "row",
        alignItems: "center",
        paddingHorizontal: 20
      },
    }),
  },
];

export default function App() {
  return (
    <NavigationContainer>
      <Stack.Navigator >
        {screens.map((screen) => (
          <Stack.Screen key={screen.name} {...screen} />
        ))}
      </Stack.Navigator>
    </NavigationContainer>
  );
}
